import React from 'react';

import imgLogo from '../../assets/images/logo-trigg.png';

function Header() {
    return (
        <header className="page-header">
            <div className="top-bar-container">
                <Link to="/">
                    <img src={imgLogo} alt="Logo Trigg"/>
                </Link>
            </div>
        </header>
    );
}

export default Header;
